import { useState } from 'react';
import './App.css';
import styled from "styled-components"

function App() {

  const [name, setName] = useState();
  const [price, setPrice] = useState();


  const alertBtn = () => {
    alert('버튼을 만들어보세요');
  }

  const inputAlertBtn = () => {
    prompt('오늘 점심 햄버거');
  }


  return (
    <div>
      <ButtonDiv>
        <h1>Button</h1>
        <BtnDiv>
          <PrimaryBtn1 onClick={alertBtn}>
            <div>Large Primary Button
            </div>
          </PrimaryBtn1>
          <PrimaryBtn2>Medium</PrimaryBtn2>
          <PrimaryBtn3>Small</PrimaryBtn3>
        </BtnDiv>
        <BtnDiv>
          <NegativeBtn1 onClick={inputAlertBtn}>Large Negative Button</NegativeBtn1>
          <NegativeBtn2>Medium</NegativeBtn2>
          <NegativeBtn3>Small</NegativeBtn3>
        </BtnDiv>
      </ButtonDiv>
      <br/>

      <h1>Input</h1>
      <div>
        <label>이름</label>
        <input/>
        <label>가격</label>
        <input/>
        <button>저장</button>
      </div>
      <br/>

      <h1>Modal</h1>
      <div>
        <button>open modal</button>
        <button>open modal</button>
      </div>
      <br/>

      <div>
      <h1>Select</h1>
      <button></button>
      <button></button>
      </div>
    </div>
  );
}

export default App;

const ButtonDiv = styled.div`
    display: flex;
    flex-direction: column;
    gap: 10px;
`

const BtnDiv = styled.div`
    display: flex;
    flex-direction: row;
    gap: 10px;
`

const PrimaryBtn1 = styled.button`
    cursor: pointer;
    border-radius: 8px;
    color: rgb(0, 0, 0);
    height: 50px;
    width: 200px;
    border: 3px solid #e0e094;
    background-color: #f5f5dc;
    font-weight: 600;
`

const PrimaryBtn2 = styled.button`
    cursor: pointer;
    border-radius: 8px;
    color: rgb(0, 0, 0);
    height: 45px;
    width: 150px;
    border: none;
    background-color: #f5f5dc;
    font-weight: 600;
`

const PrimaryBtn3 = styled.button`
    cursor: pointer;
    border-radius: 8px;
    color: rgb(0, 0, 0);
    height: 40px;
    width: 100px;
    border: none;
    background-color: #f5f5dc;
    font-weight: 600;
`

const NegativeBtn1 = styled.button`
    cursor: pointer;
    border-radius: 8px;
    color: rgb(0, 0, 0);
    height: 50px;
    width: 200px;
    border: 3px solid #bababa;
    background-color: #e9e9e9;
    font-weight: 600;
`

const NegativeBtn2 = styled.button`
    cursor: pointer;
    border-radius: 8px;
    color: rgb(0, 0, 0);
    height: 45px;
    width: 150px;
    border: none;
    background-color: #e9e9e9;
    font-weight: 600;
`

const NegativeBtn3 = styled.button`
    cursor: pointer;
    border-radius: 8px;
    color: rgb(0, 0, 0);
    height: 40px;
    width: 100px;
    border: none;
    background-color: #e9e9e9;
    font-weight: 600;
`
